import React from 'react';
import logo from './logo.svg';
import './App.css';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Toast from 'react-bootstrap/Toast';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import { Button, NavDropdown, Nav, Card, CardColumns } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import Board from './board.js'
import Scrollspy from 'react-scrollspy'

class Notes extends React.Component{
    render() {
        return (
            <Container>
                <CardColumns>
                    <Card>
                        <Card.Header>Introductory Calculus</Card.Header>
                    </Card>
                    <Card>
                        <Card.Header>Real Analysis</Card.Header>
                    </Card>
                    <Card>
                        <Card.Header>Topology</Card.Header>
                    </Card>
                    <Card>
                        <Card.Header>Functional Analysis</Card.Header>
                    </Card>




                </CardColumns>
            </Container>
        )
    }
}

export default Notes
